'use strict';

module.exports = {
  bindmethods: function bindmethods(list, obj) {
    if (!list) return;
    list.forEach(function (name) {
      if (typeof obj[name] === 'function') {
        obj[name] = obj[name].bind(obj);
      }
    });
  }
};
